Current status and source highlights
- The official TypeScript SDK lives in `modelcontextprotocol/typescript-sdk`. The `main` branch is v2 pre‑alpha, with a stable v2 targeted for Q1 2026; v1.x is still recommended for production until then. Source: `README.md` in the repo’s `main` branch (https://github.com/modelcontextprotocol/typescript-sdk/blob/main/README.md)
- The client API in `main` exposes `Client` plus transports including `StdioClientTransport`. The client docs describe connecting with `client.connect(transport)` and using `listTools`. Source: client docs (https://github.com/modelcontextprotocol/typescript-sdk/blob/main/docs/client.md)
- The stdio transport is implemented in `packages/client/src/client/stdio.ts` and spawns a local process via `command`/`args`. Source: stdio transport implementation (https://github.com/modelcontextprotocol/typescript-sdk/blob/main/packages/client/src/client/stdio.ts)
- The `Client.listTools()` helper exists and returns a tool list. Source: client class implementation (https://github.com/modelcontextprotocol/typescript-sdk/blob/main/packages/client/src/client/client.ts)

Example: stdio client connecting to a local server and listing tools (v2 main)
```ts
import { Client, StdioClientTransport } from '@modelcontextprotocol/client';

const client = new Client({ name: 'my-client', version: '1.0.0' });

const transport = new StdioClientTransport({
  command: 'node',
  args: ['path/to/your-mcp-server.js'],
  // optional: env, cwd, stderr
});

await client.connect(transport);

const { tools } = await client.listTools();
console.log(tools.map(t => t.name));

await client.close();
```

Notes
- `StdioClientTransport` spawns the server process and communicates over stdin/stdout; it’s intended for local, process‑spawned integrations. Source: stdio transport code (https://github.com/modelcontextprotocol/typescript-sdk/blob/main/packages/client/src/client/stdio.ts)
- `Client.connect(...)` triggers initialization, and `listTools()` is a high‑level helper for `tools/list`. Source: client docs and implementation (https://github.com/modelcontextprotocol/typescript-sdk/blob/main/docs/client.md, https://github.com/modelcontextprotocol/typescript-sdk/blob/main/packages/client/src/client/client.ts)

If you want a v1.x‑compatible example instead, say the word and I’ll pull from the v1.x branch.

Current info I could find (with sources), plus a clean TypeScript header example aligned with Next.js 15 + React 19:

**Current Info**
- Next.js 15 is stable and includes React 19 support, new async request APIs, and changed caching defaults (no longer cached by default for `fetch`, `GET` Route Handlers, and client navigations). Source: `https://nextjs.org/blog/next-15`
- React 19 is stable and adds Actions, `useActionState`, `<form>` actions + `useFormStatus`, `useOptimistic`, the `use` API, and updated Server Components guidance. Source: `https://react.dev/blog/2024/12/05/react-19`
- For navigation, Next.js recommends `next/link` for client-side routing. Source: `https://nextjs.org/docs/app/api-reference/components/link`

**TypeScript Header Example (App Router, React 19 + Next.js 15)**
```tsx
'use client';

import Link from 'next/link';
import { usePathname } from 'next/navigation';

const navItems = [
  { href: '/', label: 'Home' },
  { href: '/product', label: 'Product' },
  { href: '/pricing', label: 'Pricing' },
  { href: '/docs', label: 'Docs' },
];

export function Header() {
  const pathname = usePathname() ?? '/';

  return (
    <header className="site-header">
      <div className="site-header__inner">
        <Link className="site-header__logo" href="/">
          Acme
        </Link>

        <nav aria-label="Primary">
          <ul className="site-header__nav">
            {navItems.map((item) => {
              const isActive =
                item.href === '/'
                  ? pathname === '/'
                  : pathname.startsWith(item.href);

              return (
                <li key={item.href}>
                  <Link
                    className={isActive ? 'nav-link is-active' : 'nav-link'}
                    href={item.href}
                  >
                    {item.label}
                  </Link>
                </li>
              );
            })}
          </ul>
        </nav>

        <div className="site-header__actions">
          <Link className="nav-link ghost" href="/login">
            Sign in
          </Link>
          <Link className="btn" href="/contact">
            Talk to sales
          </Link>
        </div>
      </div>
    </header>
  );
}
```

